script: |
  super -f text -I q6550.spq | sort > q6550.out

inputs:
  - name: q6550.spq
    data: |
      SELECT ALL + 26 * + col2 + + + col1 * col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE 54 NOT IN ( - col1 * col0 * - + 75, - col0, col1 );
  - name: tab2

outputs:
  - name: q6550.out
    data: |
      1771
      4120
      5394
